content:
@Iit_af 선 넘네. 

굉장히 선을 넘네. 마 같은 반금수에게도 순정이라는 게 있고 프라이버시라는 게 있고 벤질메칠케톤과 메칠아민의 축합물 환원이라는 게 있다. 트라마돌을 빨 수 있을 때 구태여 맨살 까는 심리는 그래, 발정 암시고 자기전신 건, 맞는데.

나한테 짝대기 꽂는 새끼는 니가 처음이야  알아?

@이번에 진통제 먹고 깨달은 것

내 생리통 통증에 아세트 아미노펜은 무쓸모였다... 정답은 나프록센에 있었다...

사람마다 맞는 진통제가 다 달라유 누군 아세트아미노펜이 맞구 누군 이부프로펜이 맞고 누구는 나프록센이 맞고 나같이 지옥에서 올라온 새끼는 트라마돌과 진경제만이 구원할 것이다
